import React from "react";
import { BrowserRouter, Routes, Route, Link, useLocation, Navigate } from "react-router-dom";
import { AppBar, Toolbar, Button, Container } from "@mui/material";
import { GoogleOAuthProvider } from "@react-oauth/google";

import HomePage from "./pages/HomePage";
import OrderPage from "./pages/OrderPage";
import LoginPage from "./pages/LoginPage";
import SignupPage from "./pages/SignupPage";
import MerchantSignup from "./pages/MerchantSignup";
import AggregatorSignup from "./pages/AggregatorSignup";
import UserDashboard from "./pages/UserDashboard";
import PaymentSelection from "./components/PaymentSelection";

// Only inject basic white background for /dashboard, let your dashboard component handle all design
function DashboardCSSWrapper({ children }) {
  const location = useLocation();
  React.useEffect(() => {
    let styleElem = null;
    if (location.pathname === "/dashboard") {
      styleElem = document.createElement("style");
      styleElem.innerHTML = `
        body, html, #root {
          background: #f7f9fa !important;
          min-height: 100vh;
        }
      `;
      document.head.appendChild(styleElem);
    }
    return () => {
      if (styleElem) document.head.removeChild(styleElem);
    };
  }, [location]);
  return children;
}

// Professional protection for /dashboard route
function ProtectedRoute({ children }) {
  // Use token/context logic here as needed
  const isLoggedIn = localStorage.getItem("isLoggedIn") === "true";
  return isLoggedIn ? children : <Navigate to="/login" replace />;
}

// Navbar with only Home button
function MainAppBar() {
  return (
    <AppBar position="static" color="default" elevation={1} sx={{ mb: 0, bgcolor: "#fff" }}>
      <Toolbar>
        <Button component={Link} to="/" color="inherit">
          Home
        </Button>
      </Toolbar>
    </AppBar>
  );
}

function App() {
  return (
    <GoogleOAuthProvider clientId="565209562551-8kl75442g9j39u158hpa7j8ns3rrkbma.apps.googleusercontent.com">
      <BrowserRouter>
        <DashboardCSSWrapper>
          <Routes>
            <Route
              path="/dashboard"
              element={
                <ProtectedRoute>
                  <UserDashboard />
                </ProtectedRoute>
              }
            />
            <Route
              path="/"
              element={
                <>
                  <MainAppBar />
                  <Container maxWidth="md" sx={{ mt: 4 }}>
                    <HomePage />
                  </Container>
                </>
              }
            />
            <Route
              path="/order"
              element={
                <>
                  <MainAppBar />
                  <Container maxWidth="md" sx={{ mt: 4 }}>
                    <OrderPage />
                  </Container>
                </>
              }
            />
            <Route
              path="/login"
              element={
                <>
                  <MainAppBar />
                  <Container maxWidth="md" sx={{ mt: 4 }}>
                    <LoginPage />
                  </Container>
                </>
              }
            />
            <Route
              path="/signup"
              element={
                <>
                  <MainAppBar />
                  <Container maxWidth="md" sx={{ mt: 4 }}>
                    <SignupPage />
                  </Container>
                </>
              }
            />
            <Route
              path="/merchant-signup"
              element={
                <>
                  <MainAppBar />
                  <Container maxWidth="md" sx={{ mt: 4 }}>
                    <MerchantSignup />
                  </Container>
                </>
              }
            />
            <Route
              path="/aggregator-signup"
              element={
                <>
                  <MainAppBar />
                  <Container maxWidth="md" sx={{ mt: 4 }}>
                    <AggregatorSignup />
                  </Container>
                </>
              }
            />
            <Route
              path="/payment"
              element={
                <>
                  <MainAppBar />
                  <Container maxWidth="md" sx={{ mt: 4 }}>
                    <PaymentSelection />
                  </Container>
                </>
              }
            />
            <Route
              path="*"
              element={
                <>
                  <MainAppBar />
                  <Container maxWidth="md" sx={{ mt: 4 }}>
                    <HomePage />
                  </Container>
                </>
              }
            />
          </Routes>
        </DashboardCSSWrapper>
      </BrowserRouter>
    </GoogleOAuthProvider>
  );
}

export default App;
